import NavbarComponent from "../components/Navbar";
import SidebarComponent from "../components/Sidebar";


const CategoriesPage = () => {
    return (
        <>
            <NavbarComponent />
            <SidebarComponent now={'categories'} />
            <div className="w-10/12 min-h-screen px-3 pt-20 ml-80">
                <div className="w-full h-screen bg-gray-200 rounded-lg px-5 py-5">
                    <h1 className="text-3xl font-bold text-center">Categories</h1>
                </div>
            </div>
        </>
    );
}

export default CategoriesPage;
